import MiStats from '../components/miStatsDisplay';
import UsStats from "../components/usStatsDisplay";

export default () => (
    <main className="w-2/3 h-1/2">
      <h1 className="text-gray-800 leading-normal">Covid 19 Data</h1>
      <p className="text-gray-400">Michigan</p>
      <MiStats />
      <UsStats />
    </main>
  )
